import React from "react";

const foodList = [
  { id: 1, name : "kimbap", img: "https://duckduckgo.com/?q=%EA%B9%80%EB%B0%A5.jpg&t=h_&iax=images&ia=images&iai=http%3A%2F%2Fimg.theqoo.net%2Fimg%2FsbTsW.jpg"},
  { id: 2, name : "bokkumbap", img: "https://duckduckgo.com/?q=%EB%B3%B6%EC%9D%8C%EB%B0%A5.jpg&t=h_&iar=images&iax=images&ia=images&iai=http%3A%2F%2Fdramameeting.com%2Fcron%2Fimg2.php%3Fp%3Dhttps%3A%2F%2Fi.aagag.com%2Fo%2FDe27D.jpg"},
  { id: 3, name : "samgyupsal", img: "https://duckduckgo.com/?q=%EC%82%BC%EA%B2%B9%EC%82%B4.jpg&t=h_&iar=images&iax=images&ia=images&iai=https%3A%2F%2Fpds.joins.com%2Fnews%2Fcomponent%2Fhtmlphoto_mmdata%2F201702%2F27%2F117f5b49-1d09-4550-8ab7-87c0d82614de.jpg"},
]

function Food ({name, picture}) {
  return (<h2>I like {name}</h2>);
}

function renderFood (dish) {
  return <Food name={dish.name} />;
}

function App() {
  return ( 
    <div>
      {foodList.map(meal => (
        <Food key={meal.id} name={meal.name} />
      ))}
      {console.log(foodList.map(renderFood))}
    </div>
  );
}

export default App;
